import React from "react";

function Batteries() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Batteries</h1>
      <p>Do not throw batteries in regular trash. Take them to hazardous waste collection points.</p>
    </div>
  );
}

export default Batteries;
